var titles = {
  "Bank_transfer":"اختر البنك",
  "e_wallet":"اختر المحفظة",
};
var infolabel = {
  "Bank_transfer":"رقم حساب البنك",
  "e_wallet":"رقم المحفظة الإلكترونية",
};
document.getElementById("payment_method_type").addEventListener("change", function() {
  var Type = this.value;
  var options = document.getElementsByClassName("methods_options");
  for(var i = 0; i < options.length; i++){
     var a = options[i];
     a.style.display = "none";
  }
  document.getElementById("payment_method").removeAttribute("disabled");
  var my_options = document.querySelectorAll("[data-type="+Type+"]");
  for(var i = 0; i < my_options.length; i++){
     var a = my_options[i];
     a.style.display = "block";
  }
  // payment_method_title
  document.getElementById("payment_method_title").innerHTML = titles[Type];
  document.getElementById("infolabel").innerHTML = infolabel[Type];
});


